/*eslint max-len: ["error", { "code": 150 }]*/

import React, { Component } from 'react';
import { NavLink } from 'react-router-dom';
import PropTypes from 'prop-types';
import base from '../../config/api.js';
let api = base.api();


class Data extends Component {
    static propTypes = {
        match: PropTypes.object.isRequired,
        location: PropTypes.object.isRequired,
        history: PropTypes.object.isRequired
    };
    constructor(props) {
        super(props);
        this.getContent = this.getContent.bind(this);
        this.state = {
            type: this.props.match.params.type,
            data: [],
            title: "View"
        };
    }

    componentDidMount() {
        this.getContent(this.state.type);
    }

    getContent(type) {
        let that = this;
        let data = [];

        fetch(api + `/data/`)
            .then(res => res.json())
            .then(function (res) {
                res.map(function (item) {
                    data.push(
                        <div key={item.ip}>
                            <p>IP: { item.ip }</p>
                            <p>URL: { item.url }</p>
                            <p>Date: { item.day } { item.month } { item.year }</p>
                            <p>Time: { item.time }</p>
                        </div>
                    )
                });
                return true;
            })
            .then(() => this.setState({
                data: data
            }))
    }
    render() {
        return (
            <article>
                { this.state.data[0] }
            </article>
        );
    }
}

export default Data;
